contracts/helpers/fetcher.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity 0.8.24;
import "hardhat/console.sol";

import { AccessControlUpgradeable } from "@openzeppelin/contracts-upgradeable/access/AccessControlUpgradeable.sol";
import "@chainlink/contracts/src/v0.8/shared/interfaces/AggregatorV3Interface.sol";

contract PriceFetcher is AccessControlUpgradeable {

    /// @notice Address of the underlying token for price conversions
    address public underlyingToken;

    /// @notice Data structure to store price data for tokens
    struct PriceData {
        address oracleLocation_;  // Address of the oracle
        bytes functionCall_;    // Encoded function to execute on oracle
        address returnedToken_;   // Token returned by the oracle
        bool noOracle_;          // Whether the price is not taken from an oracle
    }
    error ZeroAddress(string target);

    /// @notice Mapping to store price data for each token
    mapping(address => PriceData) public tokenPrices;

    /// @notice Event emitted when price data is updated
    event PriceDataUpdated(address indexed token_, address oracleLocation_, address returnedToken_, bool noOracle_);

    /// @notice Initializes the contract with the given underlying token
    /// @param underlyingToken_ Address of the underlying token
    function initialize(address underlyingToken_) external initializer {
        _checkZeroAddress(underlyingToken_, "underlyingToken");

        __AccessControl_init();

        underlyingToken = underlyingToken_;

        _grantRole(DEFAULT_ADMIN_ROLE, _msgSender());
    }

    /// @notice Sets the price data for a token, only callable by admin
    /// @param token_ Address of the token
    /// @param oracleLocation_ Address of the oracle
    /// @param functionCall_ Encoded function to execute on oracle (can be empty if noOracle_ is false)
    /// @param returnedToken_ Token returned by the oracle
    /// @param noOracle_ Boolean to indicate if the price is not taken from an oracle
    function setPriceData(
        address token_,
        address oracleLocation_,
        bytes calldata functionCall_,
        address returnedToken_,
        bool noOracle_
    ) external onlyRole(DEFAULT_ADMIN_ROLE) {
        _checkZeroAddress(token_, "token");
        if (!noOracle_) {
            _checkZeroAddress(oracleLocation_, "oracleLocation");
            _checkZeroAddress(returnedToken_, "returnedToken");
        }

        tokenPrices[token_] = PriceData(oracleLocation_, functionCall_, returnedToken_, noOracle_);
        emit PriceDataUpdated(token_, oracleLocation_, returnedToken_, noOracle_);
    }

    /// @notice Retrieves the price of the specified token in terms of the underlying token
    /// @param token_ Address of the token
    /// @return uint256 Price of the token in terms of the underlying token
    function getTokenPrice(address token_) external view returns (uint256) {
        return _getTokenPriceInternal(token_);
    }

function _getTokenPriceInternal(address token_) internal view returns (uint256) {
    PriceData memory priceData = tokenPrices[token_];

    console.log("PriceData Retrieved", priceData.oracleLocation_, priceData.noOracle_);

    if (priceData.noOracle_) {
        uint256 result = _executeFunction(priceData.oracleLocation_, priceData.functionCall_);
        console.log("Executed Function Result", priceData.oracleLocation_, result);
        return result;
    } else {
        if (priceData.oracleLocation_ == address(0)) {
            revert("Invalid oracle location");
        }

        (, int256 price, , , ) = AggregatorV3Interface(priceData.oracleLocation_).latestRoundData();
        require(price > 0, "Invalid price data");
        uint256 priceUint = uint256(price);

        console.log("Oracle Price", priceData.oracleLocation_, priceUint);

        if (priceData.returnedToken_ != underlyingToken) {
            uint256 intermediatePrice = _getTokenPriceInternal(priceData.returnedToken_);
            require(intermediatePrice > 0, "Invalid intermediate price");
            return (priceUint * intermediatePrice) / 1e18; // Assuming 18 decimals for price
        }

        return priceUint;
    }
}



    /// @notice Internal function to execute a custom function call
    /// @param oracleLocation_ Address of the oracle or target contract
    /// @param functionCall_ Encoded function to execute
    /// @return uint256 Result of the function execution
    function _executeFunction(address oracleLocation_, bytes memory functionCall_) internal view returns (uint256) {
        (bool success, bytes memory result) = oracleLocation_.staticcall(functionCall_);
        require(success, "Function execution failed");
        return abi.decode(result, (uint256));
    }

    /// @notice Internal utility function to check for zero addresses and revert if necessary.
    /// @param variable_ Address to check
    /// @param target_ String description of the variable being checked
/// @dev Internal function to check for zero addresses and revert if necessary.
    function _checkZeroAddress(address variable_, string memory target_) internal pure {
        if (variable_ == address(0)) revert ZeroAddress({target: target_});
    }

